import './App.css';
import { useState, useEffect } from "react";
import PlaidToken from './PlaidToken';
import { Route,Routes } from 'react-router-dom'
import Register from './sign/Register';
import Login from './sign/Login';
import In from './In';
import { useNavigate } from 'react-router-dom';






function App() {

  const[currentUser,setCurrentUser]= useState()
  const navigate = useNavigate();


  function getCurrentUser(x){
    console.log(x)
    setCurrentUser(x)
  }



  return (
    <div className="App flex">
      <button>logOut</button>
      <Routes>
            <Route path="/in" element={<In currentUser={currentUser}/>}></Route>
            <Route path="/register" element={<Register/>}></Route>
            <Route path="/" element={<Login getCurrentUser={getCurrentUser}/>}></Route> 
            {/* <Route path="/in" element={<In/>}></Route>  */}
      </Routes>
    </div>
  );
}

export default App;
